        (10630, '22850203', '998551869', 'felmat@outlook.com', '', 'INTERVALLES', 1, 'AV. Ilaló N3-225 y AV. Intervalles', 'PISO: PB. SECTOR: A 100 MTS DEL BALNEARIO EL TINGO', '170151', 2),
        (10631, '0980853329', '', 'martiyos_06@hotmail.com', '', 'INTI AYMARA', 4, 'CALLE 12 DE OCTUBRE S/N AVENIDA 10 DE AGOSTO', 'COMUNA MONTAÑITA', '240102', 2),
        (10632, '0990221462', '0991727978', 'intikamari@gmail.com', 'www.intikamari.com', 'INTI KAMARI', 5, 'VIA QUILLOSISA S/N VIA GIRON PASAJE', '<h2>EN AUTO DESDE CUENCA</h2>   Sal desde el lado sur de la ciudad, sigue por la autopista 35 durante unos veinte minutos, hasta llegar a un cruce en &ldquo T&rdquo . En este cruce, manténte a la derecha. Ahora continúa en la carretera 59. Pasarás por Portete y Girón. Sigue por esta carretera durante aproximadamente una hora, hasta llegar al pueblo La Unión. El pueblo es reconocible por sus estatuas de caballos, llamadas &ldquo los caballeros&rdquo  por los lugareños. Ahora continúa en la misma carretera durante aproximadamente cinco minutos conduciendo más despacio, verás un letrero de Quillosisa (nuestra comunidad) y de Inti Kamari, gira a la derecha y sigue el camino de tierra. En dos minutos llegas a las puertas de Inti Kamari.    &nbsp    <h2>TRANSPORTE PÚBLICO</h2>   Desde la Terminal Terrestre en Cuenca, toma un autobús que te lleve a través de Girón a Santa Isabel.&nbsp Pídele al conductor que haga una parada en Quillosisa.&nbsp Este viaje dura aproximadamente una hora y media. Sigue el camino de tierra hasta llegar a las puertas de Inti Kamari.', '010850', 2),
